import React from 'react';

const Action = ({ action }) => {
  return (
    <li className="mt-4">
        <button className="btn btn-link"><h5 className="text-secondary font-weight-bold">{action.name}</h5></button>
        <p>{action.description}</p>
    </li>
  );
}

export default Action;
